  false,\n\t\"url\": null,\n\t\"notes\": \"Temperature and salinity measurements found
  in dataset IOOS taken from the BLUE (Slocum glider; WMO 4801504; operated by Univ.
  of Massachusetts Dartmouth), PENOBSCOT (Slocum glider; WMO 4801502; operated by
  Univ. of Maine), MODENA (Slocum glider; WMO 4801511; operated by SKIO; University
  of Georgia), OTN200 (Slocum glider; WMO 4800922; owned by Dalhousie University),
  OTN201 (Slocum glider; WMO 4800923; owned by Dalhousie University), WHOI_406 (Slocum
  glider #406; WMO 4801517; operated by WHOI), and UNIT_414 (Slocum glider; WMO 4801519;
  operated by Univ. of Maine) in the Coastal N Atlantic, Coastal S Atlantic and other
  locations from 2012 to 2014.nnThe Rutgers University Coastal Ocean Observation Lab
  has deployed autonomous underwater gliders around the world since 1990. Gliders
  are small, free-swimming, unmanned vehicles that use changes in buoyancy to move
  vertically and horizontally through the water column in a saw-tooth pattern. They
  are deployed for days to several months and gather detailed information about the
  physical, chemical and biological processes of the world's oceans. The Slocum glider
  was designed and built by Teledyne Webb Research Corporation, Falmouth, MA, USA.\",\n\t\"license_title\":
